import React, {useState} from "react";
import './Employees.css';
import User from "../User";




const Employees = ({users,addActiveUser,removeActiveUser}) => {
      users.sort((a,b)=>{
         let lastNameA = a.lastName.toLowerCase();
         let lastNameB = b.lastName.toLowerCase();

         if (lastNameA < lastNameB){
             return -1;
         }
         if (lastNameA > lastNameB){
             return 1;
         }

         return 0;
     });

    let array = [{
        slotStarttime: "06:00:00",
        slotTimespan: 1
    },
        {
            slotStarttime: "09:00:00",
            slotTimespan: 1
        },
        {
            slotStarttime: "12:00:00",
            slotTimespan: 2
        },
        {
            slotStarttime: "15:00:00",
            slotTimespan: 2
        },
        {
            slotStarttime: "18:00:00",
            slotTimespan: 3
        }
    ];

    let newObject = array.reduce(function(obj, value) {
        let key = `timespan${value.slotTimespan}`;
        if (obj[key] == null) obj[key] = [];

        obj[key].push(value);
        return obj;
    }, {});

    // console.log(newObject);

    return(
        <div className='Employees'>
            <h2>Employees</h2>
            <div>
                <ul className='Employees__list'>
                    {
                        users.map(user => (
                            <li key={user.id} className='Employees__list-li'>
                                <User
                                    user = {user}
                                    addActiveUser={addActiveUser}
                                    removeActiveUser={removeActiveUser}
                                />
                            </li>
                        ))
                    }
                    <li className='Employees__list-li'>

                    </li>

                </ul>
            </div>
        </div>
    )
}

export default Employees;
